# -*- coding: utf-8 -*-
import unittest
from pyramid import testing
from homescreen.departure_handler import DepartureHandler
import xml.sax
import cStringIO

def parse(raw):
    xml_reader = xml.sax.make_parser()
    departure_handler = DepartureHandler()
    xml_reader.setContentHandler(departure_handler)
    stream = cStringIO.StringIO(raw)
    xml_reader.parse(stream)
    xml_reader.close()
    return departure_handler.departure_list

class DepartureHandlerTests(unittest.TestCase):
    def setUp(self):
        self.departure_handler = DepartureHandler()

    def tearDown(self):
        pass

    def test_parse_emptytag(self):
        raw = '<ArrayOfMonitoredStopVisit xmlns:i="http://www.w3.org/2001/XMLSchema-instance" xmlns="http://schemas.datacontract.org/2004/07/Ruter.Reis.Api.Models">\'' \
              '<\ArrayOfMonitoredStopVisit>'
        result = parse(raw)
        self.assertIsNotNone(result)

